//--------------------------------------------------------------------------------
void cleanupDataFromGPU()
{
    glDeleteBuffers(1, &plan);
    glDeleteBuffers(1, &plan_colorbuffer);
    glDeleteBuffers(1, &bola);
    glDeleteBuffers(1, &bola_color_buffer);
    glDeleteBuffers(1, &resto);
    glDeleteBuffers(1, &resto_color_buffer);
    glDeleteVertexArrays(1, &VertexArrayID);
    glDeleteProgram(programID);
}

//--------------------------------------------------------------------------------
void setMVP(void)
{
    // Get a handle for our "MVP" uniform
    MatrixID = glGetUniformLocation(programID, "MVP");
    
    // Projection matrix : 45 Field of View, 4:3 ratio, display range : 0.1 unit <-> 100 units
    Projection = glm::perspective(glm::radians(50.0f), 4.0f / 3.0f, 0.1f, 100.0f);
    // Camera matrix
    View       = glm::lookAt(
                                       //Primeiro direira esquerda
                                       // SEgundo - altura



                                       //Terceiro mexe com  frente e etrs
                                       //Posio da camera -> tem de seguir a bola
                                       glm::vec3(camera_x,camera_z,camera_y), // Camera is at (4,3,-3), in World Space
                                       //glm::vec3(-13.5,50,19), Viso te cima 

                                       glm::vec3(look_at_x,look_at_z,look_at_y), // and looks at the origin
                                       // glm::vec3(0,0,0), 

                                       //glm::vec3(10,0,-40), // and looks at the origin
                                       glm::vec3(0,1,0)  // Head is up (set to 0,-1,0 to look upside-down)
                                       );

}

//--------------------------------------------------------------------------------
void draw ()
{
    // Clear the screen
    glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT);
    
    // Use our shader
    glUseProgram(programID);  

    // Send our transformation to the currently bound shader,
    // in the "MVP" uniform
    glUniformMatrix4fv(MatrixID, 1, GL_FALSE, &MVP_plan[0][0]);
    
    // 1rst attribute buffer : vertices
    glEnableVertexAttribArray(0);
    glBindBuffer(GL_ARRAY_BUFFER, plan);
    glVertexAttribPointer(
                          0,                  // attribute 0. No particular reason for 0, but must match the layout in the shader.
                          3,                  // size
                          GL_FLOAT,           // type
                          GL_FALSE,           // normalized?
                          0,                  // stride
                          (void*)0            // array buffer offset
                          );
    
    
    // 2nd attribute buffer : colors
    glEnableVertexAttribArray(1);
    glBindBuffer(GL_ARRAY_BUFFER, plan_colorbuffer);
    glVertexAttribPointer(
                          1,                                // attribute. No particular reason for 1, but must match the layout in the shader.
                          3,                                // size
                          GL_FLOAT,                         // type
                          GL_FALSE,                         // normalized?
                          0,                                // stride
                          (void*)0                          // array buffer offset
                          );
    
    
    //glEnable(GL_PROGRAM_POINT_SIZE);
    //glPointSize(10);
    // Draw the cube
    glDrawArrays(GL_TRIANGLES, 0, 98328 * 3); //

    glDisableVertexAttribArray(0);
    glDisableVertexAttribArray(1);



     // Send our transformation to the currently bound shader,
    // in the "MVP" uniform
    glUniformMatrix4fv(MatrixID, 1, GL_FALSE, &MVP_bola[0][0]);
    

    // 1rst attribute buffer : vertices
    glEnableVertexAttribArray(0);
    glBindBuffer(GL_ARRAY_BUFFER, bola);
    glVertexAttribPointer(
                          0,                  // attribute 0. No particular reason for 0, but must match the layout in the shader.
                          3,                  // size
                          GL_FLOAT,           // type
                          GL_FALSE,           // normalized?
                          0,                  // stride
                          (void*)0            // array buffer offset
                          );
    
    // 2nd attribute buffer : colors
    glEnableVertexAttribArray(1);
    glBindBuffer(GL_ARRAY_BUFFER, bola_color_buffer);
    glVertexAttribPointer(
                          1,                                // attribute. No particular reason for 1, but must match the layout in the shader.
                          3,                                // size
                          GL_FLOAT,                         // type
                          GL_FALSE,                         // normalized?
                          0,                                // stride
                          (void*)0                          // array buffer offset
                          );
    
    
    //glEnable(GL_PROGRAM_POINT_SIZE);
    //glPointSize(10);
    // Draw the cube
    glDrawArrays(GL_TRIANGLES, 0, 852 * 3); 

    glDisableVertexAttribArray(0);
    glDisableVertexAttribArray(1);




     // Send our transformation to the currently bound shader,
    // in the "MVP" uniform
    glUniformMatrix4fv(MatrixID, 1, GL_FALSE, &MVP_resto[0][0]);
    

    // 1rst attribute buffer : vertices
    glEnableVertexAttribArray(0);
    glBindBuffer(GL_ARRAY_BUFFER, resto);
    glVertexAttribPointer(
                          0,                  // attribute 0. No particular reason for 0, but must match the layout in the shader.
                          3,                  // size
                          GL_FLOAT,           // type
                          GL_FALSE,           // normalized?
                          0,                  // stride
                          (void*)0            // array buffer offset
                          );
    
    // 2nd attribute buffer : colors
    glEnableVertexAttribArray(1);
    glBindBuffer(GL_ARRAY_BUFFER, resto_color_buffer);
    glVertexAttribPointer(
                          1,                                // attribute. No particular reason for 1, but must match the layout in the shader.
                          3,                                // size
                          GL_FLOAT,                         // type
                          GL_FALSE,                         // normalized?
                          0,                                // stride
                          (void*)0                          // array buffer offset
                          );
    
    
    //glEnable(GL_PROGRAM_POINT_SIZE);
    //glPointSize(10);
    // Draw the cube
    glDrawArrays(GL_TRIANGLES, 0, 836 * 3); 

    glDisableVertexAttribArray(0);
    glDisableVertexAttribArray(1);
    

}
//--------------------------------------------------------------------------------



int main( void )
{
    // Initialise GLFW
    glfwInit();
    
    glfwWindowHint(GLFW_SAMPLES, 4);
    glfwWindowHint(GLFW_CONTEXT_VERSION_MAJOR, 3);
    glfwWindowHint(GLFW_CONTEXT_VERSION_MINOR, 3);
    glfwWindowHint(GLFW_OPENGL_FORWARD_COMPAT, GL_TRUE); // To make MacOS happy; should not be needed
    glfwWindowHint(GLFW_OPENGL_PROFILE, GLFW_OPENGL_CORE_PROFILE);
    
    // Open a window
    window = glfwCreateWindow( WindowWidth, WindowHeight, "Maze", NULL, NULL);
    
    // Create window context
    glfwMakeContextCurrent(window);
    
    // Initialize GLEW
    glewExperimental = true; // Needed for core profile
    glewInit();
    
    // Ensure we can capture the escape key being pressed below
    glfwSetInputMode(window, GLFW_STICKY_KEYS, GL_TRUE);
    
    // White background
    glClearColor(1.0f, 1.0f, 1.0f, 0.0f);
    
    // Clear the screen
    glClear( GL_COLOR_BUFFER_BIT );
    
    // Enable depth test
    glEnable(GL_DEPTH_TEST);
    // Accept fragment if it closer to the camera than the former one
    glDepthFunc(GL_LESS);
    
    // transfer my data (vertices, colors, and shaders) to GPU side
    transferDataToGPUMemory();
    

    
    // render scene for each frame
    do{


          // set the model-view-projection matrix
            setMVP();

        // Model matrix : an identity matrix (model will be at the origin)
        glm::mat4 plan_Model = glm::mat4(1.0f);
        glm::mat4 resto_Model =  glm::mat4(1.0f);
        glm::mat4 bola_Model =  glm::mat4(1.0f);



         if (glfwGetKey(window, GLFW_KEY_W)){

               ty -= 0.001;
               look_at_y -= 0.001;
               camera_y -=0.001;

        }




         if (glfwGetKey(window, GLFW_KEY_S)){

               ty += 0.001;
               look_at_y += 0.001;
               camera_y +=0.001;


        }




         if (glfwGetKey(window, GLFW_KEY_A)){



               camera_x -= 0.001;
               look_at_x -=0.001;
               tx -= 0.001;

        }




      if (glfwGetKey(window, GLFW_KEY_D)){
               look_at_x += 0.001;
               camera_x += 0.002;
               tx += 0.001;
        }

        bola_Model = glm::translate(bola_Model,glm::vec3(tx,tz,ty));

        // Our ModelViewProjection : multiplication of our 3 matrices
        MVP_plan  = Projection * View * plan_Model;
        MVP_bola  = Projection * View * bola_Model;
        MVP_resto  = Projection * View * resto_Model;

        draw();

        // Swap buffers
        glfwSwapBuffers(window);
        // looking for events
        glfwPollEvents();
        
        
    } // Check if the ESC key was pressed or the window was closed
    while( glfwGetKey(window, GLFW_KEY_ESCAPE ) != GLFW_PRESS &&
          glfwWindowShouldClose(window) == 0 );
    
    // Cleanup VAO, VBOs, and shaders from GPU
    cleanupDataFromGPU();
    
    // Close OpenGL window and terminate GLFW
    glfwTerminate();
    
    return 0;
}

